  const navigate=useNavigate();
  const handleClick=()=>{
    navigate('/userinput')
  }
  return (
    <>
      <div className='h-main'>
      <div className='h-S'>Success starts with <br></br>hardworking consultants</div>
      <div className='h'>TO JOIN OUR SERVICES</div>
      <div>CLICK HERE</div>
        <div>
          <button className='btn'  id='btn-c' type='submit' onClick={handleClick}>JOIN NOW</button>
        </div>
      </div>

    </>
  );
}

export default Home;
